import React from 'react';
import {Link} from "react-router-dom";


const Home = () => {
  return (
    <div className="">
      <div className="">
        <br/>
        <Link to={'/ListarArea'}>
         Areas
        </Link>
        <br/>
        <Link to={'/ListarObra'}>
          Obras
        </Link>
      </div>
    </div>
  );
};

export default Home;
